INSERT INTO `wp_posts` VALUES (2,1,'2015-08-23 16:43:31','2015-08-23 16:43:31','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://charlesphotography.test/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','open','open','','sample-page','','','2015-08-23 16:43:31','2015-08-23 16:43:31','',0,'http://charlesphotography.co.uk/?page_id=2',0,'page','',0),(5,1,'2015-08-23 18:13:49','2015-08-23 18:13:49','','IMG_0155','','inherit','open','closed','','img_0155','','','2015-08-23 18:13:49','2015-08-23 18:13:49','',0,'http://charlesphotography.co.uk/wp-content/uploads/2015/08/IMG_0155.png',0,'attachment','image/png',0),(6,1,'2015-08-23 18:13:55','2015-08-23 18:13:55','','IMG_0534','','inherit','open','closed','','img_0534','','','2015-08-23 18:13:55','2015-08-23 18:13:55','',0,'http://charlesphotography.co.uk/wp-content/uploads/2015/08/IMG_0534.jpg',0,'attachment','image/jpeg',0),(7,1,'2015-08-23 18:14:00','2015-08-23 18:14:00','','IMG_0550','','inherit','open','closed','','img_0550','','','2015-08-23 18:14:00','2015-08-23 18:14:00','',0,'http://charlesphotography.co.uk/wp-content/uploads/2015/08/IMG_0550.jpg'